        public void setFolio()
        {
            string sql = "SELECT  substring(codfallo, length(codfallo)-3 , 4)  AS cuenta From cfallosesp WHERE idfalloEsp = (SELECT MAX(idfalloEsp) FROM cfallosesp)";
            MySqlCommand cm = new MySqlCommand(sql, c.dbconection());
            MySqlDataReader dr = cm.ExecuteReader();
            if (dr.Read())
            {

                folio = (dr.GetInt32("cuenta") + 1) + "";
                while (folio.Length < 4)
                {
                    folio = "0" + folio;
                }
            }
            else
            {
                folio = "0001";
            }
            c.dbcon.Close();

        }
        public void setFolio(string folio)
        {

            folio = "" + Convert.ToInt32(folio.Substring(folio.Length - 4, 4));
            while (folio.Length < 4)
            {
                folio = "0" + folio;
            }
            this.folio = folio;
        }
        public String codFalla(String nomfalla)
        {
            if (nomfalla.Length > 0)
            {
                String cod = "";
                string[] split = nomfalla.Split(new char[] { '_', '.', '-', ' ' });
                foreach (string s in split)
                {

                    if (s.Trim() != "")
                        cod = cod + s.Substring(0, 1).ToUpper();
                }

                return cod + folio;
            }
            else
            {
                return "";
            }

        }
