        public void paracodrefaccion(KeyPressEventArgs pE)
        {
            if (Char.IsLetter(pE.KeyChar))
            {
                pE.Handled = false;
            }
            else if (Char.IsDigit(pE.KeyChar))
            {
                pE.Handled = false;
            }
            else if (Char.IsControl(pE.KeyChar))
            {
                pE.Handled = false;
            }
            else if (Char.IsSeparator(pE.KeyChar))
            {
                pE.Handled = false;
            }
            else if (pE.KeyChar == 45)
            {
                pE.Handled = false;
            }
            else
            {
                MessageBox.Show("Sólo se Aceptan Letras, Números y Guiones En Este Campo", MessageBoxTitle.Advertencia.ToString(), MessageBoxButtons.OK, MessageBoxIcon.Warning);
                pE.Handled = true;
            }
        }
