            if (!empresa)
            {
                mensaje = "Empleado";
            }
            bool res = true;
            if (!string.IsNullOrWhiteSpace(telefono[0]) || lada1 > 0)
            {
                if (!string.IsNullOrWhiteSpace(telefono[0]))
                {
                    if (lada1 > 0)
                    {
                        if (validaciontelefono(telefono[0]))
                        {
                            res = true;
                        } else
                        {
                            MessageBox.Show("La Longitud del Teléfono 1 de " + mensaje + " es Incorrecta", MessageBoxTitle.Advertencia.ToString(), MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
                            res = false;
                        }
                    } else
                    {
                        MessageBox.Show("Debe Seleccionar Una Lada En El Teléfono 1 de " + mensaje + " Para Poder Continuar", MessageBoxTitle.Advertencia.ToString(), MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
                        res = false;
                    }
