        public void exportaExcel(DataGridView dataGridView1)
        {

            h.Application X = new h.Application();
            X.Application.Workbooks.Add(Type.Missing);

            X.Cells.HorizontalAlignment = h.XlHAlign.xlHAlignCenter;
            X.Cells.VerticalAlignment = h.XlHAlign.xlHAlignCenter;

            for (int ColumnIndex = 0; ColumnIndex < dataGridView1.Columns.Count; ColumnIndex++)
            {
                if (dataGridView1.Columns[ColumnIndex].Visible)
                {
                    X.Cells[1, ColumnIndex] = dataGridView1.Columns[ColumnIndex].HeaderText;
                    X.Cells.Font.Name = "Calibri";
                    X.Cells.Font.Bold = true;
                    X.Cells.Font.Size = 12;
                    X.Cells[1, ColumnIndex].Interior.Color = ColorTranslator.ToOle(Color.Crimson);
                    X.Cells[1, ColumnIndex].Borders.Color = ColorTranslator.ToOle(Color.Black);
                    X.Cells[1, ColumnIndex].Font.Color = Color.White;
                }
            }
            for (int i = 0; i < dataGridView1.RowCount; i++)
            {
                for (int j = 0; j < dataGridView1.ColumnCount; j++)
                {

                    if (dataGridView1.Columns[j].Visible)
                    {
                        try
                        {
                            h.Worksheet sheet = X.ActiveSheet;
                            h.Range rng = (h.Range)sheet.Cells[i + 2, j];
                            sheet.Cells[i + 2, j] = dataGridView1[j, i].Value.ToString();
                            if (dataGridView1[j, i].Value.ToString() == "Activo".ToUpper() || dataGridView1[j, i].Value.ToString() == "No Activo".ToUpper())
                            {

                                if (dataGridView1[j, i].Value.ToString() == "Activo".ToUpper())
                                {
                                    rng.Interior.Color = System.Drawing.ColorTranslator.ToOle(Color.PaleGreen);
                                } else
                                {
                                    rng.Interior.Color = System.Drawing.ColorTranslator.ToOle(Color.LightCoral);

                                }
                            }
                            else
                            {
                                rng.Interior.Color = System.Drawing.ColorTranslator.ToOle(Color.FromArgb(231, 230, 230));

                            }
                            rng.Borders.Color = System.Drawing.ColorTranslator.ToOle(Color.Black);
                            rng.Cells.Font.Name = "Calibri";
                            rng.Cells.Font.Size = 11;
                            rng.Font.Bold = false;
                        }
                        catch (System.NullReferenceException ex)
                        {
                            MessageBox.Show(ex.ToString());
                        }
                    }

                }
            }
            System.Threading.Thread.Sleep(500);
            X.Columns.AutoFit();
            X.Rows.AutoFit();
            X.Visible = true;

        }
        public void iniCombos(string sql, ComboBox cbx, string ValueMember, string DisplayMember, string TextoInicial)
        {
            cbx.DataSource = null;
            DataTable dt = (DataTable)getData(sql);
            DataRow nuevaFila = dt.NewRow();
            nuevaFila[ValueMember] = 0;
            nuevaFila[DisplayMember] = TextoInicial.ToUpper();
            dt.Rows.InsertAt(nuevaFila, 0);
            cbx.DisplayMember = DisplayMember;
            cbx.ValueMember = ValueMember;
            cbx.DataSource = dt;

        }
